arguments.schema:
{
  "type": "object",
  "properties": {
    "id": {
      "type": "string",
      "format": "uuid",
      "description": "The unique identifier of the member"
    },
    "name": {
      "type": "string",
      "description": "The name of the member"
    },
    "email": {
      "type": "string",
      "format": "email",
      "description": "The email address of the member"
    },
    "age": {
      "type": "number",
      "minimum": 20,
      "exclusiveMaximum": 100,
      "description": "The age of the member which must be between 20 and less than 100"
    },
    "hobbies": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "id": {
            "type": "string",
            "format": "uuid",
            "description": "The unique identifier of the hobby"
          },
          "name": {
            "type": "string",
            "description": "The name of the hobby"
          }
        },
        "required": ["id", "name"]
      },
      "description": "A list of the member's hobbies"
    },
    "created_at": {
      "type": "string",
      "format": "date-time",
      "description": "The timestamp when the member was created"
    },
    "updated_at": {
      "type": "string",
      "format": "date-time",
      "description": "The timestamp when the member was last updated"
    },
    "deleted_at": {
      "oneOf": [
        {
          "type": "null"
        },
        {
          "type": "string",
          "format": "date-time"
        }
      ],
      "description": "The timestamp when the member was deleted, or null if not deleted"
    }
  },
  "required": ["id", "name", "email", "age", "hobbies", "created_at", "updated_at", "deleted_at"],
  "title": "IMember",
  "description": "A member schema representing user information with various properties"
}

